public class Solution {
    public bool IsGood(int[] nums) {
        int maxNum = nums.Max();

        // Check if the length of nums is n + 1
        if (nums.Length != maxNum + 1) {
            return false;
        }

        // Create a frequency map
        Dictionary<int, int> freqMap = new Dictionary<int, int>();
        foreach (int num in nums) {
            if (freqMap.ContainsKey(num)) {
                freqMap[num]++;
            } else {
                freqMap[num] = 1;
            }
        }

        // Check if all numbers from 1 to n - 1 occur exactly once, and n occurs exactly twice
        for (int i = 1; i <= maxNum; i++) {
            if (!freqMap.ContainsKey(i) || freqMap[i] != (i == maxNum ? 2 : 1)) {
                return false;
            }
        }

        return true;
    }
}
